class Solution(object):
    def isAnagram(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        if len(s)==len(t) and s != "" and t !="":
            t=list(t)
            for i in s:
                if i in t:
                    index=t.index(i)
                    t[index]=None
                else:
                    return False
            return True
        else:
            return False
if __name__=="__main__":
    obj=Solution()
    s=""
    t=""
    print(obj.isAnagram(s,t))